        <div className= "App-top">
          <h1> Simple OKRs </h1>
        </div>
        <div className="Content">
        <h1> Manage your team's OKRs </h1>
        <p1> Lightweight OKR management, directly from Slack.  </p1>
      </div>
      </header>
    </div>
  );
}

export default App;
